    /**
     * Replace confusable characters in a string with their replacement characters
     *
     * @param string $input
     * @return string
     */
    private function unconfuse(string $input) : string
    {
        $output = '';
        foreach (preg_split('//u', $input, -1, PREG_SPLIT_NO_EMPTY) as $originalCharacter) {
            if (isset(self::$confusables[$originalCharacter])) {
